def if_decimal_is_divisible(decimal_string):
    def fibonacci(n):
        if n == 0:
            return 0
        elif n == 1:
            return 1
        else:
            return fibonacci(n-1) + fibonacci(n-2)

    fibonacci_67th = fibonacci(67)
    decimal_integer = int(decimal_string, 2)
    return decimal_integer % fibonacci_67th == 0
